// ==UserScript==
// @name         WME Autofill Road Shields RO
// @namespace    https://github.com/onlyduckscanjudgeme/
// @version      2024.06.04
// @description  Auto-fill the roadshield based on the street name
// @author       hellror
// @license      MIT
// @match        https://www.waze.com/editor*
// @match        https://www.waze.com/*/editor*
// @match        https://beta.waze.com/editor*
// @match        https://beta.waze.com/*/editor*
// @icon         data:image/png;base64,
// @exclude      https://www.waze.com/user/editor*
// ==/UserScript==


(function() {
    'use strict';

    const css = `#autofill-button { font-size: 12px; position: absolute; top: 60px; right: 10px; }`;

    function injectCss() {
        const style = document.createElement('style');
        style.textContent = css;
        document.head.appendChild(style);
    }

    function autofill_road_shield() {
        let streetname = document.querySelector("#wz-dialog-container > div > wz-dialog > wz-dialog-header > div.street-name").innerText;
        //let regex = /(DC|DJ|DN|E|A|DEx|VO)(\d+[A-Z]?)/;
        let regex = /(DC|DJ|DN|E|A|DEx|VO)(\w+)/;


        let match = streetname.match(regex);

        if (!match) {
            alert('Atenție: Drumul nu are nevoie de indicator de orientare');
            return;
        }

        let shieldMenu = document.querySelector("#wz-dialog-container > div > wz-dialog > wz-dialog-content > div:nth-child(1) > wz-menu");
        const menuTitles = {
            "DC": "Drum Comunal",
            "DJ": "Drum Județean",
            "DN": "Drum Național",
            "VO": "Drum Național",
            "DEx": "Drum Express",
            "E": "Drum European",
            "A": "Autostradă"
        };

        const title = menuTitles[match[1]];
        if (title) {
            let menuItem = shieldMenu.querySelector(`[title="${title}"]`);
            if (menuItem) {
                menuItem.click();
            } else {
                alert(`Atenție: Indicatorul de orientare '${title}' nu este disponibil.`);
            }
        }

        let shieldTextInput = document.querySelector("#wz-dialog-container > div > wz-dialog > wz-dialog-content > div:nth-child(2) > wz-text-input");
        if (["E", "A", "DEx", "VO"].includes(match[1])) {
            shieldTextInput.value = match[1] + match[2];
        } else if (match[2]) {
            shieldTextInput.value = match[2];
        }
    }

    function regexMatch() {
        const autofillDiv = document.createElement('div');
        autofillDiv.id = "autofill-button";
        autofillDiv.innerHTML = `<wz-button>Autocomplete</wz-button>`;
        document.querySelector("#wz-dialog-container > div > wz-dialog > wz-dialog-header > div:nth-child(1)").insertAdjacentElement('afterend', autofillDiv);
        document.querySelector("#autofill-button").addEventListener("click", autofill_road_shield);
    }

    function observeRSDialog() {
        const observer = new MutationObserver(mutations => {
            mutations.forEach(mutation => {
                if (mutation.addedNodes.length > 0) {
                    if (document.querySelector("#wz-dialog-container > div > wz-dialog") && document.querySelector("#wz-dialog-container > div > wz-dialog > wz-dialog-content > div:nth-child(1) > wz-menu")) {
                        regexMatch();
                    }
                }
            });
        });
        observer.observe(document.getElementById('wz-dialog-container'), { childList: true });
    }

    function bootstrap() {
        injectCss();
        observeRSDialog();
    }

    bootstrap();
})();
